import copy
from typing import List


class Solution:

    def get_all_segments(self, grid, row_num):
        segments = []
        curr_start = None
        segment_active = False
        for i in range(len(grid[row_num])):
            if grid[row_num][i] == 1:
                if not segment_active:
                    curr_start = [row_num, i]
                    segment_active = True
            else:
                if segment_active:
                    segments.append([curr_start, [row_num, i-1]])
                    segment_active = False
        if segment_active:
            segments.append([curr_start, [row_num, len(grid[row_num]) - 1]])
        return segments

    def get_bottom_of_seg(self, grid, seg):
        strt, end = copy.copy(seg)
        curr_row, left_col, right_col = strt[0], strt[1], end[1]
        bottom = curr_row
        while curr_row < len(grid) and grid[curr_row][left_col] == 1 and grid[curr_row][right_col] == 1:
            bottom = curr_row
            curr_row += 1
        length = (bottom - strt[0])
        while (
            (any(grid[bottom][i] == 0 for i in range(left_col, right_col+1)) and bottom > strt[0]) or
            (length > (end[1] - strt[1]))
        ):
            bottom -= 1
            length = (bottom - strt[0])
        return bottom

    def is_valid_square(self, grid, seg, bottom):
        """Validate a square exists for given segment."""
        strt, end = copy.copy(seg)
        # Confirm square with equal sides
        if (bottom - strt[0]) != (end[1] - strt[1]):
            return False
        # Check valid upper border
        valid_upper = all(
            grid[strt[0]][i] == 1 for i in range(strt[1], end[1] + 1)
        )
        # Check valid with at least two units thickness
        if (bottom - strt[0] + 1) < 2:
            return False
        # Check valid bottom border
        valid_bottom = all(
            grid[bottom][i] == 1 for i in range(strt[1], end[1] + 1)
        )
        # Check valid left border
        valid_left = all(
            grid[i][strt[1]] == 1 for i in range(strt[0], bottom + 1)
        )
        # Check valid right border
        valid_right = all(
            grid[i][end[1]] == 1 for i in range(strt[0], bottom + 1)
        )
        return valid_upper and valid_bottom and valid_left and valid_right

    def calc_segment_size(self, grid, segment, increment=True):
        seg_square_size = 0
        ss, se = copy.deepcopy(segment)
        while ss[1] < se[1]:
            new_seg = [ss, se]
            bottom = self.get_bottom_of_seg(grid, new_seg)
            if not self.is_valid_square(grid, new_seg, bottom):
                if increment:
                    ss[1] += 1
                else:
                    se[1] -= 1
            else:
                slen = (se[1] - ss[1]) + 1
                swidth = (bottom - ss[0]) + 1
                seg_square_size = max(seg_square_size, slen * swidth)
                break
        return seg_square_size

    def largest1BorderedSquare(self, grid: List[List[int]]) -> int:
        """TODO: A better approach is to use a sliding window."""
        largest_square = 0
        for i in range(len(grid)):
            segs = self.get_all_segments(grid, i)
            if segs:
                largest_square = max(largest_square, 1)
            for seg in segs:
                seg_start, seg_end = seg
                left_seg_size = self.calc_segment_size(grid, [seg_start, seg_end])
                right_seg_size = self.calc_segment_size(grid, [seg_start, seg_end], False)
                largest_square = max(largest_square, right_seg_size, left_seg_size)
        return largest_square



